const atividade = ['acordar', 'correr', 'cozinhar', 'estudar', 'almoçar', 'trybe'];

const Task = (value) => {
  return (
    <li>{value}</li>
  );
}

const element = <ol>{atividade.map((item) => {
  return Task(item)})}
  </ol>

function App() {
  return (
    element
  );
}

export default App;
